import "./navbar.css";
import { useSelector, useDispatch } from "react-redux";
import { loginAction } from "../../store/login-slice";

const Navbar = (props) => {
  const isLogin = useSelector((state) => state.isLogin);
  const dispatch = useDispatch();

  const signUpHandler = () => {
    dispatch(loginAction.login(isLogin));
  };

  const loginHandler = () => {
    dispatch(loginAction.logout(isLogin));
  };

  return (
    <>
      {!isLogin && (
        <div className="navbar">
          <div className="navContainer">
            <span className="logo">Booking Website</span>
            <div className="navItems">
              <button className="navButton" onClick={signUpHandler}>
                Sign Up
              </button>
              <button className="navButton" onClick={loginHandler}>
                Login
              </button>
            </div>
          </div>
        </div>
      )}

      {isLogin && (
        <div className="navbar">
          <div className="navContainer">
            <span className="logo">Booking Website</span>
            <div className="navItems">
              <p>Email</p>
              <button className="navButton">Transacsions</button>
              <button className="navButton">Logout</button>
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default Navbar;
